const APIURL = "https://pokeapi.co/api/v2/pokemon"


function getPokemon(id) {

    fetch(`${APIURL}/${id}`)
        .then((result) => {
            return result.json()
        })
        .then((pokemon) => {
            console.log(pokemon)
        })

}

getPokemon(1)
